import React from 'react';

const Header = ({ cartCount }) => {
  return (
    <header className="header">
      <h1>쇼핑몰</h1>
      <div className="cart-info">
        <span>장바구니: {cartCount}개</span>
      </div>
    </header>
  );
};

export default Header;
